<img class="aligncenter wp-image-446" src="http://wikiceleb.com/wp-content/uploads/2017/12/france-trophy-1-300x180.jpg" alt="" width="595" height="357" />
<p style="text-align: justify;"><strong><u>World Cup Qualifier Europe</u></strong></p>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World cup Russia qualifies being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 52 countries are divided into 9 groups in which 7 groups contain 6 teams and rest of the two groups contains only 5 teams. <a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">England</a>, France, <a href="http://wikiceleb.com/germany-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Germany</a>, Italy, Netherlands and <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
<p style="text-align: justify;">France was the group leader in group A winning 7 games 2 draws and one loss. On the sixth round of the qualifier, France lost against Sweden the final score of the game was 2-1 where Giroud scored for France. The best performance of France was against the Netherlands with the final score of 4 â€“ 0 where Griezmann, Lemar, and Mbappe scored.</p>
<img class="aligncenter wp-image-447" src="http://wikiceleb.com/wp-content/uploads/2017/12/euro-france-300x165.jpg" alt="" width="609" height="335" />

